"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Group B streptococcal disease (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/group-b-streptococcal-disease-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H25198140\">",
"      <span class=\"h1\">",
"       What is group B streptococcal disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Group B streptococcal disease is an infection caused by bacteria called &ldquo;group B streptococcus,&rdquo; or &ldquo;GBS&rdquo; for short. In most healthy adults, GBS is harmless. But in pregnant women and their babies, a GBS infection can be serious.",
"     </p>",
"     <p>",
"      This article is about GBS infection in pregnant women and their babies.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25198155\">",
"      <span class=\"h1\">",
"       What are the symptoms of GBS infection in pregnant women?",
"      </span>",
"      &nbsp;&mdash;&nbsp;GBS infection often causes no symptoms. When it does cause symptoms, the symptoms depend on the organs involved. Common types of GBS infection include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bladder infection - The symptoms of a bladder infection include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Pain or a burning feeling when you urinate",
"       </li>",
"       <li>",
"        The need to urinate often",
"       </li>",
"       <li>",
"        The need to urinate suddenly or in a hurry",
"       </li>",
"       <li>",
"        Blood in the urine",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Kidney infection &ndash; The symptoms of a kidney infection can include the symptoms of a bladder infection, but they can also include fever, back pain, and nausea and vomiting.",
"       </li>",
"       <li>",
"        Amniotic infection (also called intraamniotic infection) &ndash; The symptoms of an amniotic infection include",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Tenderness in the lower part of the belly, where the uterus is found",
"       </li>",
"       <li>",
"        A fast heart rate in the mother or the fetus (unborn baby)",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25198170\">",
"      <span class=\"h1\">",
"       Is there a test for GBS infection?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Doctors can take samples of different body fluids and then check whether any GBS bacteria grow in those samples over time. This is called doing a &ldquo;culture.&rdquo;",
"     </p>",
"     <p>",
"      Most doctors recommend that all women have a urine culture for GBS early in pregnancy. Expert groups also recommend that all pregnant women have GBS cultures done on samples from the vagina and rectum at 35 to 37 weeks of pregnancy. Women who test positive for GBS can take antibiotics to treat the infection.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25198185\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if you are pregnant and have any signs of infection, such as the symptoms listed above. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25198200\">",
"      <span class=\"h1\">",
"       What problems can GBS cause to a mother or her baby?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In the mother, GBS can cause infections of the amniotic fluid or uterus, and early delivery (called preterm birth). In newborns, GBS can cause serious infections in the lungs, blood, brain and spinal cord, bones and joints, and skin and soft tissues (such as muscle or fat).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25198215\">",
"      <span class=\"h1\">",
"       How is GBS disease treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment for pregnant women involves getting an antibiotic into a vein (IV) during labor. This protects the mother and her baby from having problems caused by GBS.",
"     </p>",
"     <p>",
"      If you are treated for GBS during labor, you and the baby&rsquo;s healthcare team should watch the baby for signs of infection after he or she is born. In a baby, the signs of infection include fever or low temperature, poor feeding, trouble breathing, being irritable, and being very sleepy.",
"     </p>",
"     <p>",
"      If your baby&rsquo;s doctor thinks your baby has an infection, he or she might order blood tests, X-rays, or other tests. Babies who develop GBS infection are treated with antibiotics through an IV for at least 10 days.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25198230\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
