var title_f41_42_42669="Diagnosis of COPD I";
var content_f41_42_42669=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F53303%7EPULM%2F61983&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F53303%7EPULM%2F61983&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnosis of chronic obstructive pulmonary disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Family history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Smoking history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Age at initiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Average amount smoked per day since initiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        Date when stopped smoking or a current smoker",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3_start\">",
"        Environmental history",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist3\">",
"        The chronologically taken environmental history may disclose important risk factors for COPD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Asthma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Symptoms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Dyspnea",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Ask about the amount of effort required to induce uncomfortable breathing. Many individuals will deny symptoms of dyspnea, but will have reduced their activity levels substantially.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Cough",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Cough with or without sputum production should be an indication for spirometric testing. The presence of chronic cough and sputum has been used to define chronic bronchitis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Wheezing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Wheezing or squeaky noises occurring during breathing indicate the presence of airflow obstruction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_single\">",
"        Acute chest illnesses",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Inquire about occurrence and frequency of episodes of increased cough and sputum with wheezing, dyspnea, or fever",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Physical examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All physical findings are generally present only with severe disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Chest",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        The presence of emphysema (only when severe) is indicated by: overdistention of the lungs in the stable state (chest held near full inspiratory position at end of normal expiration, low diaphragmatic position), decreased intensity of breath and heart sounds, and prolonged expiratory phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Evidence of airflow obstruction: wheezes during auscultation on slow or forced breathing and prolongation of forced expiratory time",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Frequently observed with severe disease (characteristic, but not diagnostic): pursed-lip breathing, use of accessory respiratory muscles, retraction of lower interspaces",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Unusual positions to relieve dyspnea at rest",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Digital clubbing is NOT typical in COPD (even with associated hypoxemia) and suggests other diagnoses (eg, lung cancer, bronchiectasis, pulmonary fibrosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild dependent edema may be seen in the absence of right heart failure",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnosis of chronic obstructive pulmonary disease: PFTs",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Spirometry",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Spirometry is the essential test to confirm the diagnosis and establish the staging of COPD. If values are abnormal, a post-bronchodilator test may be indicated. Airflow limitation that is irreversible or only partially reversible with bronchodilator is suggestive of COPD rather than asthma. A postbronchodilator ratio of FEV1/FVC &lt;0.7 or &lt;LLN of FEV1/FVC is used to establish the presence of airflow limitation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         In the presence of a low FEV1/FVC, the percent of predicted FEV1 is used to determine the severity of airflow limitation.",
"        </p>",
"        <p>",
"         GOLD 1: Mild (FEV1 &ge;80 percent predicted)",
"        </p>",
"        <p>",
"         GOLD 2: Moderate (50 percent predicted &le;FEV1 &lt;80 percent predicted)",
"        </p>",
"        <p>",
"         GOLD 3: Severe (30 percent predicted &le;FEV1 &lt;50 percent predicted)",
"        </p>",
"        <p>",
"         GOLD 4: Very severe (FEV1 &lt;30 percent predicted)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Lung volumes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Body plethysmography to assess lung volumes is not necessary except in patients with a low FVC on spirometry (&lt;80 percent predicted) or when concomitant interstitial lung disease is suspected.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Diffusing capacity for carbon monoxide",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Measurement of DLCO can help establish the presence of emphysema, but is not necessary for the routine diagnosis of COPD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Chest radiography",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Only diagnostic of severe emphysema, but is frequently obtained to exclude other lung diseases.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Arterial blood gases (ABGs)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mild and moderate airflow obstruction - ABG usually not needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Moderately severe airflow obstruction - ABG is optional, but oximetry should be done. ABGs are obtained if oxygen saturation is &lt;92 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Severe and very severe airflow obstruction - ABGs are essential to assess for hypercapnia.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     PFTs: pulmonary function tests; COPD: chronic obstructive pulmonary disease; FEV1: forced expiratory volume in 1 second; FVC: forced vital capacity; LLN: lower limit of normal; GOLD: Global Initiative for Chronic Obstructive Lung Disease; DLCO: diffusing capacity for carbon monoxide; ABG: arterial blood gas.",
"     <br/>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
